#include "stb_image.h"
#include "stb_image_resize.h"
#include "fw-imgui/ui.hpp"

class Icon {
public:
	Icon(const uint32_t width, const uint32_t height, 
			const uint32_t compressed_size, const uint8_t* compressed_data)
		: m_width(width), m_height(height),
			m_image_compressed_size(compressed_size), m_image_compressed_data(compressed_data)
	{
		m_rgba_data = new uint8_t[UI::stb_decompress_length(m_image_compressed_data)];
		UI::stb_decompress(m_rgba_data, m_image_compressed_data, m_image_compressed_size);
	}

	~Icon() {
		delete[] m_rgba_data;
	}

	void Resize(uint32_t newWidth, uint32_t newHeight) {
		uint8_t* temp = new uint8_t[newWidth * newHeight * 4];

		UI::stb_resize(m_rgba_data, m_width, m_height, 0, temp, newWidth, newHeight, 0, 4);

		m_width = newWidth;
		m_height = newHeight;

		delete[] m_rgba_data;
		m_rgba_data = temp;
	}

	void ResizeByRatioH(uint32_t newHeight) {
		uint32_t newWidth = (m_width / m_height) * newHeight;

		Resize(newWidth, newHeight);
	}


	void ResizeByRatioW(uint32_t newWidth) {
		uint32_t newHeight = (m_height / m_width) * newWidth;

		Resize(newWidth, newHeight);
	}

	auto GetWidth() const { return m_width; }
	auto GetHeight() const { return m_height; };
	auto GetRGBAData() const { return m_rgba_data; }

private:
	uint32_t		m_width{ 0 };
	uint32_t		m_height{ 0 };
	uint8_t*		m_rgba_data{ nullptr };
	uint32_t		m_image_compressed_size{ 0 };
	const uint8_t*	m_image_compressed_data{ nullptr };
};

